import * as React from 'react';

interface Props {
    name: string
}

const myStyle = {
    margin: '50px 0px',
    // fontWeight: 'bold'
}

export const SideBarListElement: React.FC<Props> = ({name}) => {
    return ( 
        <li style={myStyle}>
            {name}
        </li>
    );
}
